def missingHosts = [];
// 遍历每个host的聚合结果
for (host in ctx.payload.aggregations.hosts.buckets) {
  // 如果该host在指定时间范围内没有日志
  if (host.logs.buckets[0].doc_count == 0) {
    // 将该host添加到列表中
    missingHosts.add(host.key);
  }
}
// 如果有一个或多个hosts缺失日志，则返回true
if (missingHosts.size() > 0) {
  // 可以在这里设置一个自定义变量，以便在后续的action中使用
  ctx.vars.missingHosts = missingHosts;
  return true;
}
return false;
